import React from 'react';
import classes from './IdintetyList.css';

const IdintetyList = (props) => {
  const deleteHandeler = (id) => {
    props.onDelete(id);
  };

  const updateHandeler = (id) => {
    const newName = prompt('Enter A New Name: ');

    fetch('http://localhost:3001/update', {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        newName: newName,
        id: id,
      }),
    });
  };

  return (
    <div className='pa4'>
      <div className='overflow-auto'>
        <table className='f6 w-100 mw8 center' cellspacing='0'>
          <thead>
            <tr>
              <th className='fw6 bb b--black-20 tl pb3 pr3 bg-white'>Name</th>
              <th className='fw6 bb b--black-20 tl pb3 pr3 bg-white'>Age</th>
              <th className='fw6 bb b--black-20 tl pb3 pr3 bg-white'>
                Hobbies
              </th>
              <th className='fw6 bb b--black-20 tl pb3 pr3 bg-white'>ID</th>
            </tr>
          </thead>
          <tbody className='lh-copy'>
            {props.idintetyInfo.map((info) => (
              <tr>
                <td className='pv3 pr3 bb b--black-20'>{info.name}</td>
                <td className='pv3 pr3 bb b--black-20'>{info.age}</td>
                <td className='pv3 pr3 bb b--black-20'>{info.hobbies}</td>
                <td className='pv3 pr3 bb b--black-20'>{info._id}</td>
                <button
                  onClick={() => deleteHandeler(info._id)}
                  className={classes.danger}
                >
                  DELETE
                </button>
                <button
                  onClick={() => updateHandeler(info._id)}
                  className={classes.primary}
                >
                  EDIT
                </button>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default IdintetyList;

